    const [data, setData] = React.useState([]);

    React.useEffect(() => {
    axios.get(url).then((res) => {
        console.log(res.data);
        console.log(res.data.name);
    });
    }, [setData]);



    return (
        <div>
            <h1>Get</h1>
          <p>{data.name}</p>
        </div>
    )
}

export default Get;
